INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (9,'AUT','Vienna','Western Europe',8725931,83871,'Austria is a small, predominantly mountainous country in Central Europe, approximately between Germany, Italy and Hungary. It has a total area of 83,879 km² (32,385 mi²), about twice the size of Switzerland.',1);
INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (20,'BEL','Brussels','Western Europe',11319511,30528,'Belgium is a federal state located in Western Europe, bordering the North Sea. Belgium shares borders with France (556 km), Germany (133 km), Luxembourg (130 km) and the Netherlands (478 km). Belgium comprises the regions of Flanders, Wallonia and Brussels.',12);
