INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (42,'HRV','Zagreb','Southern Europe',4190669,56594,'Croatia is described as a part of Central Europe and Southeast Europe, a part of the Balkans and Mitteleuropa. Croatia''s territory covers 56,594 km2 (21,851 sq mi), making it the 127th largest country in the world.',34);
