INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (108,'FRA','Paris','Western Europe',66710000,640679,'France consists of a terrain that is mostly flat plains or gently rolling hills in the north and west and mountainous in the south (including the Pyrenees) and the east (the highest points being in the Alps). Metropolitan France has a total size of 551,695 km2 (213,011 sq mi) (Europe only). It is the third largest country in Europe after Russia and Ukraine.',100);
INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (119,'DEU','Berlin','Western Europe',81770900,357114,'Germany is a country in west-central Europe, that stretches from the Alps, across the North European Plain to the North Sea and the Baltic Sea. Germany has the second largest population in Europe (after the European part of Russia) and is seventh largest in area. The territory of Germany covers 357,021 km2 (137,847 sq mi), consisting of 349,223 km2 (134,836 sq mi) of land and 7,798 km2 (3,011 sq mi) of waters.',111);
