INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (141,'HUN','Budapest','Eastern Europe',9823000,93028,'Hungary is a landlocked country in East-Central Europe with a land area of 93,030 square km. It measures about 250 km from north to south and 524 km from east to west. It has 2,106 km of boundaries, shared with Austria to the west, Serbia, Croatia and Slovenia to the south and southwest, Romania to the southeast, Ukraine to the northeast, and Slovakia to the north.',133);
