INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (163,'ITA','Rome','Southern Europe',60665551,301336,'Italy is located in southern Europe and comprises the long, boot-shaped Italian Peninsula, the southern side of Alps, the large plain of the Po Valley and some islands including Sicily and Sardinia. Corsica, although belonging to the Italian geographical region, has been a part of France since 1769. Italy is part of the Northern Hemisphere.',155);
