INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (196,'LUX','Luxembourg','Western Europe',576200,2586,'Luxembourg is a small country located in the Low Countries, part of North-West Europe It borders Belgium for 148 kilometres (92 miles) to the west and north, France (23 km [14 mi]) to the south, and Germany (138 km [86 mi]) to the east. Luxembourg is landlocked, separated from the North Sea by Belgium.',188);
