INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (284,'ESP','Madrid','Southern Europe',46438422,505992,'Spain is a country located in southwestern Europe occupying most (about 82% percent) of the Iberian Peninsula and includes a small exclave inside France called Llívia as well as the Balearic Islands in the Mediterranean, the Canary Islands in the Atlantic Ocean 108 km (67 mi) off northwest Africa, and five places of sovereignty (plazas de soberanía) on and off the coast of North Africa: Ceuta, Melilla, Islas Chafarinas, Peñón de Alhucemas, and Peñón de Vélez de la Gomera.',276);
