INSERT INTO geographic(id,alpha3Code,capital,sub_region,population,area,description, country_id) VALUES (306,'GBR','London','Northern Europe',65110000,242900,'The United Kingdom is a sovereign state located off the north-western coast of continental Europe. With a total area of approximately 248,532 square kilometres (95,960 sq mi), the UK occupies the major part of the British Isles archipelago and includes the island of Great Britain, the north-eastern one-sixth of the island of Ireland and many smaller surrounding islands.',298);
